public class Numbers {

	
	private static void outputNumbers() {
		int i=1;
		do {
			System.out.println(i);
			i++;
		}			
		while(i<=10);
	}
	
	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		outputNumbers();
	}

}
